export const HomeTest = () => {
  const state = false;

  return <Render welcome={state} />
}

const Render = ({welcome}) => {
  const main = () => { 
    return (
      <div>
        <div>
          <div>
            <ol>
              <li>
                <img src="assets/WeatheringWithYouVertical.jpg" />
                <h1>Server - ToDo</h1>
              </li>
              <li>
                <img src="assets/YourName.jpg" />
                <h1>Skill-Tree</h1>
              </li>
              <li >
                <img src="assets/SpiceAndWolf.jpg" />
                <h1>Gravylang</h1>
              </li>
            </ol>
          </div>
        </div>
        <ol id="bulletContainer">
          <li class="bullet"></li>
          <li class="bullet highlighted"></li>
          <li class="bullet"></li>
        </ol>
      </div>
    )
  }

  const init = () => {
    return (
      <div>
        <h1>Welcome</h1>
        <p>Press any button to continue</p>
      </div>
    )
  }

  return welcome ? init() : main();
}

export default HomeTest;
